CREATE FUNCTION public.get_channel_donation_stats(channel_name text DEFAULT NULL::text) RETURNS TABLE(nome_canal text, nro_plataforma integer, total_doacoes numeric)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT
        d.nome_canal,
        d.nro_plataforma,
        SUM(d.valor) AS total_doacoes
    FROM
        doacao d
    WHERE
        channel_name IS NULL OR d.nome_canal = channel_name
    GROUP BY
        d.nro_plataforma,
        d.nome_canal
    ORDER BY
        total_doacoes DESC;
END;
$$;


