--

CREATE FUNCTION public.get_user_membership_stats(user_nick text DEFAULT NULL::text) RETURNS TABLE(nick_usuario text, total_de_canais bigint, total_gasto numeric)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT
        i.nick_membro,
        COUNT(DISTINCT i.nome_canal),
        SUM(nc.valor)
    FROM
        inscricao i
    JOIN
        nivel_canal nc ON i.nro_plataforma = nc.nro_plataforma
                       AND i.nome_canal = nc.nome_canal
                       AND i.nivel = nc.nivel
    WHERE
        user_nick IS NULL OR i.nick_membro = user_nick
    GROUP BY
        i.nick_membro;
END;
$$;


